jQuery(function($) {
    var $window = $(window);
    var $body = $('body');
    var $navbar = $('.tm-navbar');    
    var $maincontent = $('.tm-maincontent');

    function fix() {
        if(!$navbar.hasClass("navbar-fixed")) {
            $navbar.fadeOut('fast', function() {                    
                    $navbar.addClass("navbar-fixed navbar-visible");
                    $navbar.fadeIn('fast');
                }
            );
        }
    }
    function unfix() {
        if($navbar.hasClass("navbar-fixed")) {
            $navbar.fadeOut('fast', function() {                    
                    $navbar.removeClass("navbar-fixed navbar-visible");
                    $navbar.fadeIn('fast');
                }
            );
        }
    }
    function check() {
        //console.log('scroll check run');
        if($body.hasClass('uk-offcanvas-page')) {
            return;
        }
        var menuOffset = $navbar.height();
        var winTop = $window.scrollTop();
        //var winTop = $maincontent.scrollTop();
        //console.log('winTop', winTop);
        //console.log('menuOffset', menuOffset);
        
        //winTop > 100 ? $navbar.addClass("navbar-hidden") : $navbar.removeClass("navbar-hidden");
        //winTop > 400 ? $navbar.addClass("navbar-fixed") : $navbar.removeClass("navbar-fixed");
        
        winTop > menuOffset && winTop ? fix() : unfix();
    }

    //console.log('add scroll check');
    

    //console.log('$maincontent', $maincontent);
    //console.log('$body', $body);
    //console.log('$window', $window);
    check();
    $window.scroll(check);
    //$maincontent.scroll(check);

    //console.log('added scroll check');

});

var animationPlayers = {};

function resizeAnimations() {
    var winWidth = window.innerWidth;

    for(k in animationPlayers) {
        //console.log('resizeAnimations k', k);
        if (!animationPlayers.hasOwnProperty(k)) continue;
        var v = animationPlayers[k];
        if(v.fluid) {
            //console.log('resizeAnimations v', v);
            var $container = jQuery('#' + k).parent();
            if (v.fluid) {
                //           v.player._resize(window.innerWidth, window.innerHeight);
            } else {
            }
            //console.log('$container.innerWidth()', $container.innerWidth());
            //console.log('$container.innerHeight()', $container.innerHeight());
            var newWidth = $container.innerWidth();
            var newHeight = newWidth / v.width * v.height;
            v.player._resize(newWidth, newHeight);
        }
    }

    /*
    $(animationPlayers).each(function(k,v) {
        console.log('resizeAnimations k', k);
    });
    */

}

function startAnimation(WRAPPER_ID, fluid, width, height, animation) {
    var wrapper = document.getElementById(WRAPPER_ID);
    jQuery('#'+WRAPPER_ID).empty();
    var playerParams = {
        width: width,
        height: height,
        autoPlay: true,
        repeat: true,
        controlsEnabled: false
    };

    document.body.className = 'no-iframe';
    wrapper.className = 'no-iframe';

    if(fluid) {
        wrapper.style.width = '100%';
    } else {
        wrapper.style.width = playerParams.width + 'px';
    }
    wrapper.style.height = playerParams.height + 'px';
    /*
    wrapper.style.marginLeft = -Math.floor(playerParams.width / 2) + 'px';
    wrapper.style.marginTop = -Math.floor(window.innerHeight / 2) + 'px';
    */

    var player;
    if ('anm' in window) {
        console.log('anm in window');
        player = anm.createPlayer(WRAPPER_ID, playerParams)
        ;
        player.load(animation,
            anm.importers.create('animatron'));
    } else if ('animatron' in window) {
        console.log('animatron in window');
        player = animatron.createPlayer(WRAPPER_ID, playerParams);
        player.load(animation);
    }

    animationPlayers[WRAPPER_ID] = {
        'player': player,
        'width': width,
        'height': height,
        'fluid': fluid,
    };
}

